import styled from "styled-components";
import { containerStyle } from "../../assets/styles";

export default {
  Container: styled.div`
    margin: 30px 120px;
    width: 100%;
    ${containerStyle};
  `,
  Switcher: styled.div`
    padding: 25px;
    display: flex;
    flex-direction: row;
  `,
  Button: styled.button`
    padding: 19px 0px;
    width: 50%;
    text-decoration: none;
  `,
};
